  }

  return (  
    <div className="App">
      <h1 style={{textAlign: 'center'}}> The Million Dollar NFT </h1>

      <br></br>
      <div class="homepage" style={{ borderStyle: 'solid',  margin: 'auto', height:'1000px', width:'1000px', backgroundColor: '#FFFF'}}>        
        {squareInfo.map(() => {
          return <Square></Square>
        })}
      </div>
    </div>
  );
}

export default App;
